from functools import cache
from sympy import divisors
@cache
def b(n, k) -> bool:
    if n <= k: return True
    for d in divisors(n)[1:-1]:
        if d > k: return False
        if b(n // d, d - 1): return True
    return False
def isa(n) -> bool: return any(b(n, k) for k in range(2, n))
